        <style>
            .jaalone, .jaaltwo {
                background: url(https://pianu.com/wp-content/themes/pianu/img/pianodots.png);
                height: 145px;
                width: 28%;
                background-repeat: repeat-x;
                background-size: contain;
                margin: 0 auto;
                border-radius: 30px;
            }

            .newquerytable {
                width: 40%;
                display: flex;
                flex-direction: row;
                align-items: center;
                justify-content: center;
            }

            .controls-wrap {
                background: url(https://pianu.com/wp-content/themes/pianu/img/pianoheadbg.png);
                background-repeat: repeat-x;
                background-size: contain;
                padding: 0;
                padding-top: 20px;
                padding-bottom: 20px;
                border-top-left-radius: 10px;
                border-top-right-radius: 10px;
            }

            .newquerytable {
                border-radius: 15px;
                width: 40%;
                display: flex;
                flex-direction: row;
                align-items: flex-start;
                justify-content: center;
                background: url(https://pianu.com/wp-content/themes/pianu/img/quertybg.png);
                min-height: 150px;
                background-size: contain;
                background-repeat: repeat-x;
                padding: 20px 0;
                border: 3px solid #000;
            }

            .insidelearn {
                margin: 0 auto;
                color: #fff;
                text-align: center;
                width: 38%;
                padding: 30px;
                background: url(https://pianu.com/wp-content/themes/pianu/img/anyonebg.png);
                background-repeat: repeat-x;
                background-size: contain;
                border-bottom-right-radius: 10px;
                border-bottom-left-radius: 10px;
                margin-top: -2px;
                font-weight: bold;
                font-size: 20px;
            }

            .hero-keyboard .keyboard-dude {
                background: url(https://pianu.com/wp-content/uploads/2018/09/keyboard-page-min-min.png) no-repeat center center;
                background-size: cover !important;
            }

            body.page-template-academy .mainpagediv {
                background: #5b299a !important;
            }

            @media screen and (max-width: 767px) {
                .blog-image {
                    background: none !important;
                }

                body.night, .branding.night, #header.night {
                    background: #242424 !important;
                }

                .keyboard-controls {
                    transform: scale(1);
                    width: 100%;
                    transform-origin: 0 0;
                    height: 30px;
                }
            }
        </style>
